&quot;Furious 7&quot; is a 2015 American action film. It is the sequel to the 2013 film Fast &amp; Furious 6 and the seventh installment in the Fast &amp; Furious film series. The film was written by Chris Morgan and directed by James Wan. It stars Vin Diesel, Paul Walker, Dwayne Johnson, Michelle Rodriguez, Jordana Brewster, Tyrese Gibson, Ludacris and Jason Statham. With the previous three installments being set between 2 Fast 2 Furious (2003) and The Fast and the Furious: Tokyo Drift (2006), Furious 7 is the first film of the series to mostly take place after Tokyo Drift. Furious 7 was released on April 3, 2015.


